# 并且在异常的处理上目前还不够完善，有些异常直接忽略的话会存在很大的问题。
# 倘若粗暴处理异常，那么在一些非完全使用六字符的 jsfuck 的处理里面就不能更好的解压代码。
# 后续还需要考虑八字符的 jsfuck ，也就是再加上 {} 这种类型处理的部分。
# 目前这里能处理的字符串统一使用单引号，后续再考虑双引号的处理

'''
一些运算参考表

# +
+true       1
+false      0
+[]         0
+''         0
+'asdf'     NaN
+'123123'   123123
+123        123
+undefined  NaN

# !
![]         false
!''         true
!'asdf'     false
!true       false
!false      true
!undefined  true

# [?] 
[][[]]      undefined
[][true]    undefined
[?][?]      undefined # 通常 [][?] 这种类型就是通过找列表对象找不到则返回一个undefined

# ''
'' + 'asdf'     # 'asdf'        字符串
'' + 123        # '123'         字符串
'' + undefined  # 'undefined'   字符串
'' + true       # 'true'        字符串
'' + false      # 'false'       字符串
'' + [true]     # 'true'        字符串
'' + [false]    # 'false'       字符串
'' + [123,123]  # '123,123'     字符串
'' + NaN        # 'NaN'         字符串

# []
同上，都会生成字符串

# 123
123 + 'asdf'    # 字符串
123 + 123       # 数字
123 + undefined # NaN
123 + true      # 124
123 + false     # 123
123 + [true]    # 字符串
123 + [false]   # 字符串
123 + [123,123] # '123123,123'
123 + NaN       # NaN



自行实现js的计算，统计一下所有的类型：
数字
字符串
undefined
true,false 
null
NaN

'''

import re

def cuter(string, force=True):
    # 正确的分割算数单元，结果返回一个列表
    # eg.  '+!+[]+[0]+[][[]]+![true]+!+[]+!+[false]'
    #  => ['+!+[]', '+', '[0]', '+', '[][[]]', '+', '![true]', '+', '!+[]', '+', '!+[false]']
    def combine(p):
        # 合并相连的中括号， [?] 将拼接的列表连接在一起。因为是一个计算单元
        # eg. []      [[]]  => [][[]]
        # eg. 'asdf'  [3]   => 'asdf'[3]
        pr = None
        ci = 0
        cb = {}
        for cr in sorted(p):
            if pr:
                if pr[1] == cr[0]:
                    if ci not in cb: cb[ci] = []
                    if pr not in cb[ci]: cb[ci].append(pr)
                    if cr not in cb[ci]: cb[ci].append(cr)
                else:
                    ci += 1
                    if ci not in cb: cb[ci] = []
                    if cr not in cb[ci]: cb[ci].append(cr)
            else:
                if ci not in cb: cb[ci] = []
                if cr not in cb[ci]: cb[ci].append(cr)
            pr = cr
        d = {}
        for pi in sorted(cb):
            v = cb[pi]
            l, r = v[0][0], v[-1][1]
            d[(l, r)] = ''.join([p[i] for i in v])
        return d
    list_left, list_right = '[]'
    tupl_left, tupl_right = '()'
    s = string
    p = {}
    l, r = 0, 0
    _list  = 0
    _name  = 1
    _int   = 2
    _str   = 3
    _tuple = 4
    def find(string, r):
        '''
        在查找时，同时获取下一个结构的类型，虽然jsfuck只用很少的字符
        不过在层层解析的过程中，还是会生成其他类型的数据，所以需要考虑到这类型的数据分割
        并且在一定情况下，原始的脚本就是混合 jsfuck 的。一开始就有其他类型的数据，所以还是需要考虑。
        _list , _int , _str, _name, _tuple
        '''
        _ints = list(map(str,range(10)))
        te = re.findall(r"[a-zA-Z0-9$_\[\(']", s[r:])
        if te:
            if te[0] == list_left:
                ft = _list
            elif te[0] == tupl_left:
                ft = _tuple
            elif te[0] == "'":
                ft = _str
            elif te[0] in _ints:
                ft = _int
            else:
                ft = _name
            return string.find(te[0], r), ft
        else:
            return -1, None

    q, ft = find(s, 0)
    t = True
    while t:
        c = []
        if q == -1: break
        for idx,i in enumerate(s[q:]):
            if ft == _list:
                if i == list_left:  c.append(list_left)
                if i == list_right: c.pop()
                if len(c) == 0:
                    l, r = q, q + idx + 1
                    p[(l, r)] = s[l:r]
                    q, ft = find(s, r)
                    break
            elif ft == _tuple:
                if i == tupl_left:  c.append(tupl_left)
                if i == tupl_right: c.pop()
                if len(c) == 0:
                    l, r = q, q + idx + 1
                    p[(l, r)] = s[l:r]
                    q, ft = find(s, r)
                    break
            else:
                if   ft == _name: v = re.findall(r'[a-zA-Z0-9$_]+', s[r:])[0]
                elif ft == _int:  v = re.findall(r'[0-9]+', s[r:])[0]
                elif ft == _str:  v = re.findall(r"'[^']+'", s[r:])[0]
                l, r = q, q + len(v)
                p[(l, r)] = s[l:r]
                q, ft = find(s, r)
                break
        if len(c) > 0: t = False
    s = string
    d = combine(p)
    k = sorted(d)
    ll, rr = 0, len(s) + 1
    if k:
        q = [ll]
        for l,r in k:
            q.append(l); q.append(r)
        q.append(rr)
        e = {}
        w = {}
        pr = ''
        for i in range(len(q) - 1):
            k, v = (q[i], q[i+1]), s[q[i]:q[i+1]]
            if i%2 == 0: 
                # c = re.findall(r'\+!+\+$|\+$', v)
                c = re.findall(r'\+((?:!+\+)?)$', v)
                c.extend(re.findall(r'\+((?:!+)?)$', v))
                pr = c[0] if c else ''
                e[k] = v[:len(v) - len(pr)]
            if i%2 == 1: 
                w[k] = pr + v
        e.update(w)
        k = sorted(e)
        r = [e[i] for i in k]
        if len(r) >= 2 and (r[0].endswith('+') or r[0].endswith('!') or not r[0]):
            r = [r[0] + r[1]] + [i for i in r[2:] if i]
        return r
    else:
        print('error', string)
        return ['[{}]'.format(string)]

def plus(ls):
    '''
    通过将列表内的表达式进行比较初级的元映射后，进行运算变换
    这里的运算变换会考虑到不同类型的 js 隐式转换，虽然不一定能完全覆盖
    但是从原运算的角度来考虑的话，会更加贴近真实的解析状态
    原始函数经过切分函数后生成切分单元列表，然后再经过本函数后即可处理元映射计算处理
    eg. ['+!+[]', '+', '[0]', '+', '[][[]]', '+', '![true]', '+', '!+[]', '+', '!+[false]', '+', '!+[123]', '+', '!+[undefined]', '+', '[123123]', '+', "['asdfasdf']"]
     => '10undefinedfalsetruetruefalsetrue123123asdfasdf'
    原函数 +!+[]+[0]+[][[]]+![true]+!+[]+!+[false]+!+[123]+!+[undefined]+[123123]+['asdfasdf'] 
    '''
    _unfind     = -1
    _int        = 0
    _str        = 1
    _undefined  = 2
    _boolen     = 3
    _null       = 4
    _NaN        = 5
    _list       = 6
    q = [
        ["[]",      "[]",       _list],
        ["[][[]]",  "undefined",_undefined],
        ["[![]]",   "false",    _str],
    ]
    e = [
        [r'^\+(!*)\[\]$',           "_bint_",    _int],
        # ["+![]",    "0",        _int],
        # ["+!![]",   "1",        _int],
        # ["+[]",     "0",        _int],
        [r'^\+(!+)\+\[\]$',         "_binti_",   _int],
        # ["+!+[]",   "1",        _int],
        # ["+!!+[]",  "0",        _int],
        [r'^(!+)\[\]$',             "_bool_",   _boolen],
        [r'^(!+)\+\[\]$',           "_booli_",  _boolen],
        # ["!+[]",    "true",     _boolen],
        # ["!!+[]",   "false",    _boolen],
        # ["![]",     "false",    _boolen],
        # ["!![]",    "true",     _boolen],
        [r'^(\d+)$',                None,       _int],
        [r"^'([^']+)'$",            None,       _str],
        [r"^('[^']+'\[\d+\])$",     "_eval_",   _str],
        [r"^('[^']+'\['\d+'\])$",   "_evalr_",  _str],
        [r"^\['([^']+)'\]$",        None,       _str],
        [r'^\[(.*)\]$',             None,       _list],
        [r"^\[\]\[[^'\[\]]+\]$",    "undefined",_undefined], 
        # 这里考虑放弃对方法字符串的判断 [1][2] 这种结构中的 2 部分将不接受字符串匹配
        # 因为这里可能会获取到函数，我这里的功能不包括实现 js 内部函数块
        [r'^!\[.+\]$',              "false",    _boolen],
        [r'^!(\d+)$',               "_int_",    _boolen],
        [r'^\+\[null\]$',           "0",        _int],
        [r'^\+\[undefined\]$',      "0",        _int],
        [r'^\+\[(\d+)\]$',          None,       _int],
        [r'^\+\[NaN\]$',            "NaN",      _NaN],
        [r"^\+\['([^']+)'\]$",      "NaN",      _NaN],
        [r"^!\+\['([^']+)'\]$",     "true",     _boolen],
        [r'^!\+\[(\d+)\]$',         "_int_",    _boolen],
        [r'^!\+\[\w+\]$',           "true",     _boolen],
    ]
    def get_fit(s):
        if isinstance(s, (list,tuple)):
            return s
        for i in q:
            i.copy()
            if s == i[0]:
                return i
        for i in e:
            i = i.copy()
            v = re.findall(i[0], s)
            if v:
                if   i[1] is None:      i[1] = v[0]
                elif i[1] == '_int_':   i[1] = 'false' if int(v[0]) else 'true'
                elif i[1] == '_eval_':  i[1] = eval(v[0])
                elif i[1] == '_evalr_': i[1] = eval(re.sub(r"\['(\d+)'\]$", r'[\1]', v[0]))
                elif i[1] == '_bint_':  i[1] = '0'      if v[0].count('!')%2 == 1 or v[0].count('!') == 0 else '1'
                elif i[1] == '_binti_': i[1] = '1'      if v[0].count('!')%2 == 1 else '0'
                elif i[1] == '_bool_':  i[1] = 'false'  if v[0].count('!')%2 == 1 else 'true'
                elif i[1] == '_booli_': i[1] = 'true'   if v[0].count('!')%2 == 1 else 'false'
                return i
        return ['', '', _unfind]
    def parse_type(xv, xt, tp):
        if tp == _NaN:
            return 'NaN'
        if tp == _int:
            if xt != _int:
                if xv == 'true':    return '1'
                if xv == 'false':   return '0'
                if xv == 'null':    return '0'
            else:
                return xv
        if tp == _str:
            if xt != _str:
                if xv == '[]':
                    return ''
                else: 
                    return xv
            else:
                return xv
    def _plus(a, b):
        '''
        这里还需要增加一些无法计算类型的处理
        比如一些变量名字的计算暂时不需要考虑，过早的加入那个会使得问题复杂化。
        k:key 
        v:value 
        t:targettype
        '''
        ak, av, at = a
        bk, bv, bt = b
        types = [at, bt]
        if _list in types or _str in types:
            rt = _str
        elif _NaN in types or _undefined in types:
            rt = _NaN
        elif _int in types:
            if types.count(_int) == 2:
                rt = _int
            elif _boolen in types or _null in types:
                rt = _int
        elif _boolen in types:
            if types.count(_boolen) == 2:
                rt = _int
            elif _null in types:
                rt = _int
        elif _null in types:
            if types.count(_boolen) == 2:
                rt = _int
        _a = parse_type(av, at, rt)
        _b = parse_type(bv, bt, rt)
        if rt == _NaN: val = 'NaN'
        if rt == _str: val = _a + _b
        if rt == _int: val = int(_a) + int(_b)
        return None,str(val),rt
    
    l = ls[::-1]
    t = True
    p = []
    if len(l) < 3:
        v = get_fit(l.pop())
        # 这里是个重要的地方，如需后续有必要考虑到递归处理，那么应该就会在这里处理递归的部分
        v = parse_type(v[1], v[2], _str)
        return v if v else repr(v)
    while t and len(l):
        p.append(l.pop())
        if len(p) == 3 and p[1] == '+':
            left  = get_fit(p[0])
            right = get_fit(p[2])
            p = [_plus(left, right)]
    return repr(p[0][1]) if p[0][2] == _str else p[0][1]


